import TableItem from './TableItem'


function Table() {
    const items = ['mela', 'banana', 'kiwi'];
    const items2 = [<TableItem name="mela" />, <TableItem name="banana" />, <TableItem name="kiwi" />];
  return (
    <div className="Table">
          <TableItem name="melon" />
          <TableItem name="gurke" />
          {items.map(item => <TableItem name={item} />)}
    </div>
  );
}

export default Table;
